import { createTheme } from "@mui/material/styles";


const theme = createTheme({
 palette: {
   primary: {
     main: "#2196f3",
   },
   secondary: {
     main: "#f50057",
   },
 },
 typography: {
   fontFamily: "Arial, sans-serif",
   fontSize: 16,
 },
 spacing: 8,
});


export default theme;
